  $city isa city, has city_name "New York City";
  $supplier isa organization, has name $sn;
  (organization: $o, city: $city) isa located_in;
  (customer: $o, supplier: $supplier) isa supplies;
limit 3;
fetch { "supplier": $sn };

match
